const request = new XMLHttpRequest();
//apikey = "72357f2dc9e0efd0a5ed92fe81487f60"
request.open("GET", "https://gnews.io/api/v4/search?q=example&apikey=72357f2dc9e0efd0a5ed92fe81487f60")
request.send();
request.onload = () => {
    console.log(request);
    if(request.status === 200) {
        console.log(JSON.parse(request.response));
    }
}
